import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { PokemonProvider } from './context/PokemonContext';

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <PokemonProvider>
      <App />
    </PokemonProvider>
  </React.StrictMode>
)
